import React, { Component } from "react";
import "./TNode.css";

export default class TNode extends Component {
  render() {
    const { 
      row, 
      col, 
      isStart, 
      isFinish, isVisited, handleMouseClick } = this.props;

    const extraClassName = isStart
      ? "TNode-start"
      : isFinish
      ? "TNode-finish"
      : "";

    return <div className={`TNode ${extraClassName}`}></div>;
  }
}
